import css from './Fax.module.css';
import { Link, useActionData } from 'react-router-dom';
import faqIcon from '../../icons/faq-icon.svg';
import { useState } from 'react';

export default function Faq() {
  [question, setquestion] = useState(false);
  return (
    <section className={css.faqSection}>
      <div className="section-title">Questions? Let's answer them!</div>

      <p className={css.faqText}>
        If you need more help, make sure to click to get help from our{' '}
        <Link className={css.faqLink} to="/">
          live support.
        </Link>
      </p>

      <div className={css.faqWrap}>
        <div className={css.faqBlock}>
          <div className={css.faqContent}>
            <div className={css.faqTitle}>
              What payment methods do you accept?
            </div>
            <img className={css.faqImage} src={faqIcon} alt="faqIcon" />
          </div>
          <p className={css.faqDesc}>
            On Stormlikes you can pay using all major credit and debit cards.
            This includes cards issued by VISA, Mastercard, and AMEX. On top of
            that, if you are using a compatible device you will also get an
            option to pay using Apple Pay which is a very convenient option.
          </p>
        </div>
      </div>
    </section>
  );
}
